export const initialState={

    mainPosts: [{
        id:1,
        User:{
            id:1,
            nickname:'YJ',
        },
        content: '더미 데이터 #해시캐그 #익스프레스'
    }],
}

const reducer = (state=initialState,action)=>{
    switch(action.type){
        default:
            return state;
    }
};



export default reducer;
